import React from 'react';
import ItemTramo from './ItemTramo';
import styles from './ListaRecursos.module.css'

const LISTA_HORAS = [
      {
        id: "h1",
        hora: "8:00 A.M.",
      },
      {
        id: "h2",
        hora: "8:30 A.M.",
      },
      {
        id: "h3",
        hora: "9:00 A.M.",
      },
      {
        id: "h4",
        hora: "9:30 A.M.",
      },
      {
        id: "h5",
        hora: "10:00 A.M.",
      },
      {
        id: "h6",
        hora: "10:30 A.M.",
      },
      {
        id: "h7",
        hora: "11:00 A.M.",
      },
      {
        id: "h8",
        hora: "11:30 A.M.",
      },
      {
        id: "h9",
        hora: "12:00 P.M.",
      },
      {
        id: "h10",
        hora: "12:30 P.M.",
      },
      {
        id: "h11",
        hora: "1:00 P.M.",
      },
      {
        id: "h12",
        hora: "1:30 P.M.",
      },
    ];


const ListaRecursos = (props) => {
    return <div className={styles.lista}><ItemTramo/></div>
};

export default ListaRecursos;
